import logo from '../../assets/logo.svg';
import './App.css';

import React, {useState} from 'react';

import CuisineCard from '../../components/CuisineCard';

function App() {
  const [state, setState] = React.useState({
    cuisine: [
      'hamburger',
      'pizza',
      'friedchicken',
      'vegetarian',
      'vegan',
      'fastfood',
      'seafood',
      'breakfast',
      'tacos',
      'asian'
    ]
  })

  return (
    <div className="App">
        <CuisineCard cuisine={state.cuisine[1]} />
    </div>
  );
}

export default App;
